import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Button, Image } from 'semantic-ui-react';

export default class Test extends Component {
    render() {
        return (
            <div>
                <Link to='/'><Button>click to go back</Button></Link>
                <Image></Image>
            </div>
        );
    }
}
